class FileManager:
    _cache = set()

    @staticmethod
    def cache_d_file_request(request_id: str) -> bool:
        """Cache D File generation requests."""
        if request_id in FileManager._cache:
            return False
        FileManager._cache.add(request_id)
        logger.info(f"Cached D File request {request_id}")
        return True

