# Database models
class Submission(Base):
    __tablename__ = 'submissions'
    id = Column(String, primary_key=True)
    publish_status = Column(String)
    status_change_log = Column(String)
    deletion_date = Column(Date)
    status_labels = Column(String)

class User(Base):
    __tablename__ = 'users'
    id = Column(String, primary_key=True)
    dabs_read_only = Column(Boolean)

class FABSFile(Base):
    __tablename__ = 'fabs_files'
    id = Column(String, primary_key=True)
    name = Column(String)
    is_published = Column(Boolean)

# Create indexes
Index('idx_submission_status', Submission.publish_status)
Index('idx_fabs_published', FABSFile.is_published)

# Create tables
